import './ArrowButton.scss'

const ArrowButton = () => {

    return (
        <button className='arrow-button'
            onClick={() => navigate(-1)}>
            <img src="/images/arrow-left.svg" alt="Назад"></img>
        </button>
    )
}

export default ArrowButton;
